import React, {useState, useEffect} from 'react';
import { Link } from 'react-router-dom';
import { initiateGetProfile } from '../actions/profile';
import { getProfile } from '../actions/profile';
import Loading from '../components/Loading'
import { Navbar, Nav } from 'react-bootstrap';

import { useDispatch } from 'react-redux'

const dispatch = useDispatch;

const Header = () => {
  const [profile, setProfile] = useState(
    {
      profile_name: null,
      error_msg: '',
      is_submitted: false
    }
  );
  //       this.props.dispatch(initiateGetProfile());
  const [tick, setTick] = useState(false);



  useEffect(() => {
    if (tick == 0) {
      getProfile().then(res => {
        console.log("heee")
        console.log(res);
        setProfile(res)
        console.log(profile)
      })


      // dispatch()
      ;
    }
    setTick(1)
  });

  if (profile.profile_name == null) {
    return <Loading/>
  }

  return (
    <Navbar>
      <p text-align = "left"><strong>
      {profile.profile_name}</strong></p>
      <Navbar className="justify-content-end" style={{ width: "100%" }}>
            Eee
        </Navbar>
      <p text-align = "right" className="links">
        <Link to="/logout" className="link">
          Logout
        </Link>
      </p>
    </Navbar>
  );
};

export default Header;
